import React from 'react';
import { View, Text, Image, ScrollView, StyleSheet } from 'react-native';

const Profile = () => {
  return (
    <ScrollView>
      {/* Left Side - Previous Game List */}
      <View style={styles.box}>
        <Text style={styles.boxTitle}>Previous Game List</Text>
        {/* Add previous game list content here */}
      </View>

      {/* Right Side - Upcoming Game List */}
      <View style={styles.box}>
        <Text style={styles.boxTitle}>Upcoming Game List</Text>
        {/* Add upcoming game list content here */}
      </View>

      {/* Middle Section */}
      <View style={styles.box}>
        {/* Welcome Message */}
        <Text style={styles.middleText}>Welcome, User Name</Text>

        {/* User Image */}
        <Image
          source={{ uri: 'https://example.com/fake-pic.jpg' }}
          style={styles.image}
        />

        {/* Assigned Groups */}
        <View style={styles.box}>
          <Text style={styles.boxTitle}>Assigned Groups</Text>
          {/* Add options for assigned groups */}
          <Text>Group One</Text>
          <Text>Group Two</Text>
          <Text>Group Three</Text>
          {/* ... Add more options as needed */}
        </View>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  box: {
    backgroundColor: 'white',
    borderRadius: 10,
    borderWidth: 1,
    borderColor: 'black',
    padding: 10,
    margin: 10,
  },
  boxTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    marginTop: 10,
  },
  middleText: {
    fontSize: 24,
    fontWeight: 'bold',
  },
  image: {
    width: 200,
    height: 200,
    marginTop: 10,
  },
});

export default Profile;
